import CardBook from '../components/CardBook'
import Waterfall from '../components/Waterfall'
import Head from 'next/head'

const App = () => (
  <div className="container">
    <Head />
    1
    <Waterfall
      renderItem={item => (
        <CardBook post={item}/>
      )}
      dataSource={[
          {
            title: 'title',
            image: '//aa',
            type: 'image',
            user: {
                username: 'username',
                avatar: '//aa'
            },
            count: {
                likes: 1
            }
        },
        {
          title: 'title',
          image: '//aa',
          type: 'image',
          user: {
              username: 'username',
              avatar: '//aa'
          },
          count: {
              likes: 1
          }
        }
      ]}
    />
  </div>
)

export default App
